import React, { Component } from "react";
import {
	StyleSheet,
	Text,
	View,
	Image,
	TouchableWithoutFeedback,
	StatusBar,
	
	SafeAreaView,
	Keyboard,
	TouchableOpacity,
	KeyboardAvoidingView,
	AppRegistry,
	Dimensions,
	Button,
} from "react-native";
import { TextInput } from "react-native-paper";
import BG2 from "../assets/images/loginbg-removebg-preview.png"; 

class LoginScreen extends Component {
	constructor() {
		super();
		this.state = {
			text: '',
		};
	}
	render() {
		const { navigation } = this.props;

		return (
			<SafeAreaView style={styles.container}>
				<StatusBar barStyle="light-content" />
				<KeyboardAvoidingView behavior="padding">
					<TouchableWithoutFeedback onPress={Keyboard.dismiss}>
						<View>
							<View style={styles.topText}>
								<Text style={{ color: "white" }}>Logo Here</Text>
								<Text
									style={{
										fontSize: 32,
										marginStart: 50,
										color: "white",
										fontWeight: "bold",
									}}
								>
									Welcome To
								</Text>
							</View>
							<Text style={{textAlign:'center',color:'white',fontSize:32, fontWeight:"bold"}}>Lift Lae Ly</Text>

							<Image
								source={BG2}
								style={{  marginTop: 40 }}
							/>

							<View>
								<View>
									<Text style={{ color: "white", fontSize:18,fontWeight:'bold' }}>Phone Number</Text>
									<TextInput
										label=" Enter Your Phone Number"
										value={this.state.text}
										onChangeText={(text) => this.state.text(text)}
										style={{ marginTop: 15 }}
									/>
								</View>
								<Button
									onPress={() => navigation.navigate("Dashboard")}
									title="Get OTP"
									style={styles.Button}
								/>
							</View>
						</View>
					</TouchableWithoutFeedback>
				</KeyboardAvoidingView>
			</SafeAreaView>
		);
	}
}
const android = Dimensions.get("window");
const styles = StyleSheet.create({
	container: {
		flex: 1,
		width: android.width * 1.1,
		height: android.height * 1.1,
		backgroundColor: "#1F4690",
	},

	topText: {
		flexDirection: "row",
		// alignItems:'center'
		// justifyContent: "space-around",
		marginTop: 30,
		
	},
	Button: {
		marginTop: 10,
	},
});

export default LoginScreen;
